import React from 'react';

function Reports() {
  return (
    <div className='reports'>
      <h1>Reports</h1>
      <script type='text/javascript' src='https://code.jquery.com/jquery-3.4.1.min.js' type='text/javascript'></script>
<script type='text/javascript' src='https://ajax.googleapis.com/ajax/libs/jqueryui/1.11.4/jquery-ui.min.js' type='text/javascript'></script>
<script type='text/javascript' src='https://www.calcxml.com/scripts/tipped/comboTipped.js' type='text/javascript'></script>
<script type='text/javascript' src='http://cdnjs.cloudflare.com/ajax/libs/jquery-ajaxtransport-xdomainrequest/1.0.2/jquery.xdomainrequest.min.js'></script>
<script type='text/javascript' src='https://www.calcxml.com/scripts/loadCalc.js?calcTarget=sav01&embed=2&skn=62'></script>
<div id='calc' style='padding-top: 10px;'></div>
    </div>
  );
}

export default Reports;
